import React from 'react';

function AddButton({ onAddTask, taskText }) {
  const handleButtonClick = () => {
    if (taskText.trim() !== '') {
      onAddTask(taskText);
    }
  };

  return (
    <button className="add" onClick={handleButtonClick}>
      Add todo
    </button>
  );
}

export default AddButton;
